<header id="title-block-header">
<h1 class="title">20210519</h1>
<p class="author"><a href="index.html">Takala</a></p>
</header>
<p>川内で開催している100円朝食キャンペーンに行ってきた．</p>
<p><strong><a href="https://www.tohoku.u-coop.or.jp/home/info/8548/">【東北大学×東北大生協】100円朝食の実施について | 東北大学生協</a></strong></p>
<p>やはり需要はあるのか，朝8時にも関わらず飯にありつこうと飢えた学生たちが列をなしていた．</p>
<p>しかも時期が時期なので会話は一切なく，足早に着席し，もくもくと食べるのみ． さながら刑務所のようであった．</p>
<p>なんにせよ100円で朝ごはんが食べられるのはありがたい． 一時的なものでなく，今後も続けて欲しい企画だ．</p>
<p>ちなみに本日の100円定食はこちら．学食なんて久しぶりにいったのでとても懐かしい感じ．</p>
